<i>XML Example of OData V4 with the Importance Annotation</i>
<pre>
   &lt;Property Name="Customer"&gt;
     &lt;Annotation Term="UI.Importance" EnumMember="UI.ImportanceType/High" /&gt;
   &lt;/Property&gt;
   &lt;Property Name="CompanyCode"&gt;
